import React from 'react';
import {Link} from 'react-router-dom';
import '../css/Login.css';

function Login() {
    return (
        <div className="Login">
            <header>
                <h5>째그만 이모티콘 그림</h5>
                <h3> 다이어리 이름 </h3>
            </header>

            <content>
                <h5>아이디 입력</h5>
                <h5>비번 입력</h5>
                <h5><Link to='/main'>로그인 버튼</Link></h5>
                <h5><Link to='/signup'>회원가입 버튼</Link></h5>
            </content>

            <footer>
                <h5>개발자 : 최솔</h5>
            </footer>

        </div>
    )
}

export default Login;
